import React from "react";


function AboutMe({ about }) {
  if (!about) return null;
  return (
    <section style={{ padding: "20px", background: "#f9f9f9" }}>
      <h2>About Me</h2>
      <p>{about.bio}</p>
      <p>Email: {about.email}</p>
      <p>Phone: {about.phone}</p>
      <p>Location: {about.location}</p>
      <p>LinkedIn: {about.socials?.linkedin}</p>
      <p>Twitter: {about.socials?.twitter}</p>
    </section>
  );
}

export default AboutMe;
